import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => (
  <nav className=''>
    <Link to="/">Search Books</Link>
    <Link to="/bookshelf">My Bookshelf</Link>
  </nav>
);

export default NavBar;
